def set_user_data(data:dict):
    user_data.USER_NAME = data.get("user_name")
    user_data.USER_API = data.get("api-key")
    user_data.USER_SECREAT = data.get("api-secreat")
    user_data.USER_UID = data["auther"].get("UID")
    user_data.USER_ATYPE = data["auther"].get("accountType")
    user_data.USER_ID = data["auther"].get("id")